import styled from "styled-components";

export const HomeButtonStyle = styled.button`
  #home_btn {
    position: absolute;
    top: 0;
    left: 0;

    margin: 6vw 0 0 5vw;
    cursor: pointer;
  }

  img {
    opacity: 0.5;
    width: 30px;
    transition: 0.3s ease-out;

    &:hover {
      opacity: 0.8;
    }
  }
`;
